// VARIABLES
import Error404 from '../../assets/images/404Error-amico.png'

function PageError() {
    return (
        <main>
            <section className='errorImgContainer'>
                <img 
                    src={Error404} 
                    alt="Erreur 404" 
                    className='errorImgContainer__img'
                />
            </section>
        </main>
    )
}

export default PageError;
